import {BrowserRouter, Route, Routes} from 'react-router-dom'
import Home from './pages/Home';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path='/' elements={<Home/>}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
